import { createApp, defineAsyncComponent } from "vue";
import { createRouter, createWebHistory } from "vue-router";
import axios from "axios";
import App from "./App.vue";



// static pages allways loaded
import LoginPage from "./components/LoginPage.vue";

//async pages, loaded only when needed! not in advance
const PagesHolder = () => import("./components/PagesHolder.vue");
const ProjectsCards = () => import("./components/pages/ProjectsCards.vue");
const ManageUsers = () => import("./components/pages/ManageUsers.vue");
const Project = () => import("./components/pages/ProjectDashboard.vue");    // Dashboard for one ofr the app (CDE or QMS or SafetyFile...etc)
const SingleProject = () => import("./components/pages/SingleProject.vue"); // page where can be selected app for project (CDE, QMS, SafetyFIle...etc)

//--CDE pages
const TreeHolder= () => import("./components/pages/TreeHolder.vue");

const CDEtodo = () => import("./components/pages/CDE/CDEtodo.vue");

const CDEfiles= () => import("./components/pages/CDE/CDEfiles.vue");
const CDEdrawings= () => import("./components/pages/CDE/CDEdrawings.vue");
const CDEtechnical= () => import("./components/pages/CDE/CDEtechnical.vue");
const CDErfi= () => import("./components/pages/CDE/CDErfi.vue");

const CDEshare= () => import("./components/pages/CDE/CDEshare.vue");
const CDEmessages= () => import("./components/pages/CDE/CDEmessages.vue");
const CDEgroups= () => import("./components/pages/CDE/CDEgroups.vue");
const CDEdownload= () => import("./components/pages/CDE/CDEdownload.vue");



//includable parts of the page
import TopBar from "./components/include/TopBar.vue";
import SidebarCDE from "./components/include/SidebarCDE.vue";

/// some UI
import BaseDialog from "./components/ui/BaseDialog.vue";
import BaseSpinner from "./components/ui/BaseSpinner.vue";
import SearchHolder from "./components/ui/SearchHolder.vue";
import SidebarmenuLink from "./components/ui/SidebarMenuLink.vue";
import SidebarMenuLinkDirect from "./components/ui/SidebarMenuLinkDirect.vue";
import Multiselect from '@vueform/multiselect'; //multi select userguide: https://github.com/vueform/multiselect

//import charts:
import BarChart from './components/ui/BarChart.vue';
import DoughnutChart from './components/ui/DoughnutChart.vue'

//import tree 
import vue3treeVue from 'vue3-tree-vue'




// block of code sometimes loaded
const ContactInfo = defineAsyncComponent(() =>
  import("./components/ui/ContactInfo.vue")
);
const VersionInfo = defineAsyncComponent(() =>
  import("./components/ui/VersionInfo.vue")
);

const router = createRouter({
  history: createWebHistory(""),
  routes: [
    { path: "/", component: LoginPage, meta: { requiresUnAuth: true } },
    {
      path: "/pages",
      component: PagesHolder,
      redirect: "/pages/projectList",

      children: [
        {
          path: "/pages/projectList",
          component: ProjectsCards,
          name: "ProjectsCards",
          meta: { requiresAuth: true },
        },
        {
          path: "/pages/manageUsers",
          component: ManageUsers,
          meta: { requiresAuth: true },
        },

        {
          path: "/pages/project/:projectId",
          component: SingleProject,
          meta: { requiresAuth: true },
        },
        {
          path: "/pages/project/:appType/:projectId",
          component: Project,
          meta: { requiresAuth: true },
        },

        // CDE PAGES
        {
          path: "/pages/projects/CDE/",
          component: TreeHolder,
          meta: { requiresAuth: true },

          children: [
            {
              path: "/pages/projects/CDE/todo/:projectId",
              component: CDEtodo,
              name: "To do list",
              meta: { requiresAuth: true },
            },

            {
              path: "/pages/projects/CDE/files/:projectId",
              component: CDEfiles,
              name: "Files",
              meta: { requiresAuth: true },
            },
            {
              path: "/pages/projects/CDE/drawings/:projectId",
              component: CDEdrawings,
              name: "Drawings",
              meta: { requiresAuth: true },
            },
            {
              path: "/pages/projects/CDE/technical/:projectId",
              component: CDEtechnical,
              name: "Technical",
              meta: { requiresAuth: true },
            },
            {
              path: "/pages/projects/CDE/rfi/:projectId",
              component: CDErfi,
              name: "RFI",
              meta: { requiresAuth: true },
            },
            {
              path: "/pages/projects/CDE/share/:projectId",
              component: CDEshare,
              name: "Share",
              meta: { requiresAuth: true },
            },
            {
              path: "/pages/projects/CDE/messages/:projectId",
              component: CDEmessages,
              name: "Messages",
              meta: { requiresAuth: true },
            },
            {
              path: "/pages/projects/CDE/groups/:projectId",
              component: CDEgroups,
              name: "Groups",
              meta: { requiresAuth: true },
            },
            {
              path: "/pages/projects/CDE/download/:projectId",
              component: CDEdownload,
              name: "Download",
              meta: { requiresAuth: true },
            },
          ]

        },

        //-- end CDEÅ¡pages

      ],
    },
  ],
});




router.beforeEach(function (to, from, next) {
  if (to.meta.requiresAuth && !store.getters.isAuthenticated) {
    next("/");
  } else {
    store.dispatch("autoLogin");
    // next();
  }

  if (to.meta.requiresUnAuth && store.getters.isAuthenticated) {
    next("/pages/projectList");
  } else {
    store.dispatch("autoLogin");
    next();
  }
});

const app = createApp(App);
  import store from "./store/index.js";

//global variables
app.config.globalProperties._rootVersion = process.env.VUE_APP_VERSION; // get From package.json
//-- more variables loaded from /settings.json


axios.get("/settings.json").then((resp) => {
  var settings = resp.data;
  var obj = settings[0];

  Object.keys(obj).forEach(function (key) {
    var value = obj[key];

    //global variables read from /settings.json file!!
    if (key == "RestUrl") {
      app.config.globalProperties._rootRestUrl = value;
      localStorage.setItem('_rootRestUrl',value);
    }

    if (key == "AppTitle") {
      app.config.globalProperties._rootAppTitle = value;
    }
    if (key == "DefaultProjectCard") {
      app.config.globalProperties._rootDefaultProjectCard = value;
    }
    if (key == "LoginBackground") {
      app.config.globalProperties._rootLoginBackground = value;
    }
    if (key == "LoginLogo") {
      app.config.globalProperties._rootLoginLogo = value;
    }
    if (key == "LoginLogoWhite") {
      app.config.globalProperties._rootLoginLogoWhite = value;
    }
    if (key == "LinkToHelpFile") {
      app.config.globalProperties._rootlinkToHelpFile = value;
    }
    if (key == "LinkToUpdateHistory") {
      app.config.globalProperties._rootLinkToUpdateHistory = value;
    }



  });



  app.use(router);
  app.use(store);

  app.use(vue3treeVue);

  app.component("top-bar", TopBar);
  app.component("sidebar-cde", SidebarCDE);

  app.component("login-page", LoginPage);

  app.component("version-info", VersionInfo);
  app.component("contact-info", ContactInfo);
  app.component("search-holder", SearchHolder);
  app.component("base-spinner", BaseSpinner);
  app.component("base-dialog", BaseDialog);
  app.component("menu-link", SidebarmenuLink);
  app.component("menu-linkdirect", SidebarMenuLinkDirect);
  app.component("v-select", Multiselect);
  app.component("line-chart", BarChart);
  app.component("doughnut-chart", DoughnutChart);



  app.mount("#app");
 });

